const App = () => { 
  return (
    <AppProvider>
      <div className="app">
        <Header />
        <Routes>
          <Route path="/" element={
            <>
              <Banner />
              <RestaurantsLists /> 
              <RestaurantCard />
              <Cart />
            </>
          } />
          <Route path="/signin" element={<SignIn />} /> {/* SignIn route */}
        </Routes>
      </div>
    </AppProvider>
  )
}


export default App;
